var staticCacheName="restaurant-cache-v1",filesToCache=["/","../index.html","../restaurant.min.html","../css/styles.min.css","./dbhelper.js","./main.js","./restaurant_info.js","../data/restaurants.json","../img/1.jpg","../img/2.jpg","../img/3.jpg","../img/4.jpg","../img/5.jpg","../img/6.jpg","../img/7.jpg","../img/8.jpg","../img/9.jpg","../img/10.jpg"];self.addEventListener("install",function(e){e.waitUntil(caches.open(staticCacheName).then(function(e){return console.log("Cache is opened"),e.addAll(filesToCache)}))}),self.addEventListener("active",function(e){e.waitUntil(caches.keys().then(function(e){return Promise.all(e.filter(function(e){return e.startsWith("restaurant-")&&e!=staticCacheName}).map(function(e){return caches.delete(e)}))}))}),self.addEventListener("fetch",function(e){e.respondWith(caches.match(e.request).then(function(t){return t||fetch(e.request)}).catch(function(t){console.log("Error : ",t,e.request)}))});